import {
    SetupFunctionalContent,
    SetupFunctionalContainer,
    SetupHeroContainer,
    SetupStepIcon,
    SetupWrapper, SetupHeroStyling
} from "../styled/Setup.styled.css";
import {LoginSubtitle, LoginTitle} from "../styled/Login.styled";
import {useGoogleLogin} from '@react-oauth/google';
import {MagicButton} from "../components/Buttons";
import {Hero} from "../assets/hero-docs.svg"

function Login() {

    const login = useGoogleLogin({
        onSuccess: tokenResponse => console.log(tokenResponse),
    });

    return (
        <SetupWrapper>
            <SetupHeroStyling/>
            <SetupFunctionalContainer>
                <SetupFunctionalContent>
                    <SetupStepIcon className="bi bi-house-door"></SetupStepIcon>
                    <LoginTitle>Identifiez-vous en un clic !</LoginTitle>
                    <LoginSubtitle>Clac ! En un claquement de doigts !</LoginSubtitle>
                    <MagicButton onClick={() => login()}>Se connecter avec Google</MagicButton>
                </SetupFunctionalContent>
            </SetupFunctionalContainer>
            <SetupHeroContainer>
                <img src={Hero} className={"setup-hero"}/>
            </SetupHeroContainer>
        </SetupWrapper>
    );
}

export default Login;
